import { Component, Output, EventEmitter } from '@angular/core';

@Component({
  selector: 'app-share-voyage',
  templateUrl: './share-voyage.component.html',
  styleUrls: ['./share-voyage.component.css']
})
export class ShareVoyageComponent {
  email: string = '';
  @Output() onShareVoyage = new EventEmitter<string>();

  shareVoyage(): void {
    this.onShareVoyage.emit(this.email);
  }
}
